    [],nt"revision_timestamp": "2016-08-04T08:17:44.485118",nt"name": "narrative-report-of-aleutian-islands-national-wildlife-refuge-and-izembek-national-wildlif",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Aleutian Islands
    and Izembek NWRs outlines Refuge accomplishments from September through December
    of 1961. The report begins by summarizing the weather conditions, habitat conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, violations, and safety. Items of interest, N-R forms, and photographs are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
